import styled from 'styled-components'

export const Main = styled.main`
  width: 100%;
  display: flex;
  flex-direction: column;
`

export const OverviewParagraph = styled.p`
  font-size: 1.5em;
  max-width: 60ch;
  text-align: center;
  width: fit-content;
  align-self: center;
`
